import { createApp } from 'vue'
import App from './App.vue'
import "bootstrap/dist/css/bootstrap.min.css"
import "bootstrap"
import $ from 'jquery'

createApp(App).mount('#app')

$(".projectContainer").on("click", function(){
	var imgSrc = $(this).closest("img").attr('src');
});
